import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input field by its placeholder and fill it
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    await searchInput.fill('iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // 2. Locate the search button and click it
    // Using a selector for the button immediately following the search input
    const searchButton = page.locator('input#searchInput + button.search-btn');
    await searchButton.waitFor({ state: 'visible', timeout: 5000 });
    await searchButton.click();

    // 3. Wait for search results to appear and take a screenshot
    // The JS on the page updates the content, so we wait for the results header
    await page.waitForSelector('h2:has-text("Search Results for \\"iPhone\\"")', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 4. Extract data to verify the search was successful
    const resultsCountElement = page.locator('.results-count');
    const resultsCountText = await resultsCountElement.textContent();
    const productTitleElement = page.locator('.product-card .product-title').first();
    const firstProductTitle = await productTitleElement.textContent();

    return {
      success: true,
      action: "Searched for 'iPhone' and verified results were displayed.",
      extractedData: {
        resultsCount: resultsCountText.trim(),
        firstProductTitle: firstProductTitle.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    return {
      success: false,
      action: "Failed to search for products",
      extractedData: {},
      screenshots: [path.join(screenshotsDir, 'error.png')],
      error: error.message
    };
  }
}
